text_show:
Anns an oideachadh roimhe, dh’ ionnsaich sinn mun ghnìomh array_fill a tha dìreach a’ lìonadh raon le luachan. Bidh an gnìomh array_fill_keys a’ lìonadh raon le luachan mu choinneamh nan iuchraichean ainmichte.
Dè an co-chòrdadh a th’ aig gnìomh array_fill_keys ann am PHP?
array_fill_keys(keys, value)
Eisimpleir de ghnìomh array_fill_keys
<?php
$keys=array("a","b","c","d");
$a1=array_fill_keys($keys,"blue");
print_r($a1);
?>
Anns an eisimpleir gu h-àrd, chruthaich sinn sreath a bhios mar na h-iuchraichean airson gnìomh array_fill_keys. An uairsin chuir sinn seachad an raon chun ghnìomh agus sònraich sinn an luach a tha ri thoirt dha na h-iuchraichean againn. Bidh toradh an eisimpleir gu h-àrd mar raon anns a bheil na luachan againn agus an sreang ainmichte mar na luachan aca.
